import styled from "styled-components";

const StyledError = styled.div`
  background: url("https://www.pngkit.com/png/detail/798-7987663_picture-teenage-drinking-diary-of-a-parish-priest.png")
    no-repeat center;
  background-size: cover;
  width: 100%;
  height: 40rem;
`;

const StyledWrapper = styled.div`
  background: rgba(1, 1, 1, 0.5);
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;

const StyledText1 = styled.div`
color: #e5ff60;
text-transform: uppercase
text-align: initial;
padding: 2rem;
font-size: 1.5rem
`

const StyledNumber = styled.p`
  font-size: 15rem;
  margin: 0;
  font-weight: bold;
  color: white;
`;

const ErrorPage = () => {
  return (
    <StyledError>
      <StyledWrapper>
        <StyledText1>oops... page is not found!</StyledText1>
        <div>This page is empty just like your drink.</div>
        <StyledNumber>404</StyledNumber>
        <div>Don't worry! Just follow the link below to back home page</div>
        <button>Go back to Home Page</button>
      </StyledWrapper>
    </StyledError>
  );
};

export default ErrorPage;
